import React from "react"

class Myclass extends React.Component
{

    //class properties
    id=1001;
    email="thirumal@gmail.com"


    //constructor
    constructor(props)
    {
          super(props);
    }


    myfun()
    {
        return "This is OWN FUNCTION <br />"
    }

    //Prepare The Component_Input
    //class_method
    render()
    {
        return(<>
                <h1>REACT CLASS COMPONENT</h1>
                {this.id}-{this.email}-${this.myfun()}
        </>);
    }
}



export default Myclass
